export const login = ({ username, password }) => {
    return new Promise((resolve, reject) => {
        setTimeout(() => {
            if (Math.random() > 0.5) {
                resolve({
                    username: `${username}`
                });
            } else {
                throw(new Error('Impossible!'));
            }
        }, 5000);
    });
};
